  false,\n\t\"url\": null,\n\t\"notes\": \"Data and information collected by the submersible
  Johnson Sea-Link II along its track during fourteen dives of the 2003 \"Investigating
  the Charleston Bump\" expedition sponsored by the National Oceanic and Atmospheric
  Administration (NOAA) Office of Ocean Exploration, August 2 through August 16, 2003.
  Measurements and information include sub's position, altitude, and depth; personnel
  assignments; dive, mission, and vehicle ID's; and sound velocity measurements. The
  Marine Operations Division of the Harbor Branch Oceanographic Institution provided
  the original submersible data.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
